import React from "react";
import Logo from "./Logo";

const Header = ({darkMode, setDarkMode}) => (
  <div className="flex flex-col gap-10">
    <Logo darkMode={darkMode} setDarkMode={setDarkMode}/>
  </div>
);

export default Header;
